import React, { useState, useEffect } from "react";
import axios from "axios";
import { motion } from "framer-motion";
import { GlassCard, GlassCardHeader, GlassCardContent, GlassCardTitle } from "../../components/ui/glass-card";
import { Badge } from "../../components/ui/badge";
import { Button } from "../../components/ui/button";
import { 
  Mail, 
  Phone, 
  Calendar, 
  MessageCircle,
  CheckCircle,
  Eye,
  Search,
  Filter
} from "lucide-react";

const ContactSubmissions = ({ adminToken }) => {
  const [submissions, setSubmissions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState("all"); // all, read, unread
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    fetchSubmissions();
  }, [adminToken]);

  const fetchSubmissions = async () => {
    try {
      const headers = { Authorization: `Bearer ${adminToken}` };
      const response = await axios.get(
        `${process.env.REACT_APP_BACKEND_URL}/api/admin/contact-submissions`,
        { headers }
      );
      setSubmissions(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching submissions:', error);
      setLoading(false);
    }
  };

  const markAsRead = async (submissionId) => {
    try {
      const headers = { Authorization: `Bearer ${adminToken}` };
      await axios.patch(
        `${process.env.REACT_APP_BACKEND_URL}/api/admin/contact-submissions/${submissionId}/read`,
        {},
        { headers }
      );
      
      setSubmissions(prev =>
        prev.map(submission =>
          submission.id === submissionId
            ? { ...submission, is_read: true }
            : submission
        )
      );
    } catch (error) {
      console.error('Error marking as read:', error);
    }
  };

  const filteredSubmissions = submissions
    .filter(submission => {
      if (filter === "read") return submission.is_read;
      if (filter === "unread") return !submission.is_read;
      return true;
    })
    .filter(submission =>
      submission.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      submission.email.toLowerCase().includes(searchTerm.toLowerCase()) ||
      submission.service.toLowerCase().includes(searchTerm.toLowerCase())
    );

  if (loading) {
    return (
      <div className="flex items-center justify-center py-20">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-slate-900"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header & Controls */}
      <div className="flex flex-col md:flex-row md:items-center md:justify-between space-y-4 md:space-y-0">
        <div>
          <h1 className="text-2xl font-bold text-slate-900">Contact Submissions</h1>
          <p className="text-slate-600">
            {submissions.length} total submissions, {submissions.filter(s => !s.is_read).length} unread
          </p>
        </div>

        <div className="flex flex-col sm:flex-row space-y-2 sm:space-y-0 sm:space-x-4">
          {/* Search */}
          <div className="relative">
            <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-slate-400 w-4 h-4" />
            <input
              type="text"
              placeholder="Search submissions..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="pl-10 pr-4 py-2 border border-slate-300 rounded-lg focus:ring-2 focus:ring-slate-900 focus:border-transparent"
            />
          </div>

          {/* Filter */}
          <select
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            className="px-4 py-2 border border-slate-300 rounded-lg focus:ring-2 focus:ring-slate-900 focus:border-transparent"
          >
            <option value="all">All Submissions</option>
            <option value="unread">Unread Only</option>
            <option value="read">Read Only</option>
          </select>
        </div>
      </div>

      {/* Submissions List */}
      <div className="space-y-4">
        {filteredSubmissions.length > 0 ? (
          filteredSubmissions.map((submission) => (
            <motion.div
              key={submission.id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              layout
            >
              <GlassCard className={`transition-all duration-300 ${
                !submission.is_read 
                  ? 'border-blue-200 bg-blue-50/50' 
                  : 'hover:shadow-lg'
              }`}>
                <GlassCardContent className="p-6">
                  <div className="flex items-start justify-between">
                    <div className="flex-1 space-y-4">
                      {/* Header */}
                      <div className="flex items-center justify-between">
                        <div className="flex items-center space-x-3">
                          <h3 className="text-lg font-semibold text-slate-900">
                            {submission.name}
                          </h3>
                          {!submission.is_read && (
                            <Badge className="bg-blue-600 text-white">New</Badge>
                          )}
                        </div>
                        
                        <div className="flex items-center space-x-2 text-sm text-slate-500">
                          <Calendar className="w-4 h-4" />
                          {new Date(submission.submitted_at).toLocaleDateString('en-US', {
                            year: 'numeric',
                            month: 'short',
                            day: 'numeric',
                            hour: '2-digit',
                            minute: '2-digit'
                          })}
                        </div>
                      </div>

                      {/* Contact Info */}
                      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                        <div className="flex items-center space-x-2 text-slate-600">
                          <Mail className="w-4 h-4" />
                          <a 
                            href={`mailto:${submission.email}`}
                            className="hover:text-slate-900 transition-colors"
                          >
                            {submission.email}
                          </a>
                        </div>
                        
                        <div className="flex items-center space-x-2 text-slate-600">
                          <Phone className="w-4 h-4" />
                          <a 
                            href={`tel:${submission.phone}`}
                            className="hover:text-slate-900 transition-colors"
                          >
                            {submission.phone}
                          </a>
                        </div>
                      </div>

                      {/* Service */}
                      <div>
                        <Badge variant="outline">{submission.service}</Badge>
                      </div>

                      {/* Message */}
                      <div className="bg-slate-50 rounded-lg p-4">
                        <div className="flex items-start space-x-2">
                          <MessageCircle className="w-4 h-4 text-slate-500 mt-0.5 flex-shrink-0" />
                          <p className="text-slate-700 leading-relaxed">
                            {submission.message}
                          </p>
                        </div>
                      </div>
                    </div>

                    {/* Actions */}
                    <div className="ml-6 flex flex-col space-y-2">
                      {!submission.is_read ? (
                        <Button
                          onClick={() => markAsRead(submission.id)}
                          size="sm"
                          className="bg-blue-600 hover:bg-blue-700 text-white"
                        >
                          <Eye className="w-4 h-4 mr-1" />
                          Mark Read
                        </Button>
                      ) : (
                        <Button
                          size="sm"
                          variant="outline"
                          className="text-green-600 border-green-600"
                          disabled
                        >
                          <CheckCircle className="w-4 h-4 mr-1" />
                          Read
                        </Button>
                      )}
                    </div>
                  </div>
                </GlassCardContent>
              </GlassCard>
            </motion.div>
          ))
        ) : (
          <GlassCard>
            <GlassCardContent className="text-center py-12">
              <MessageCircle className="w-12 h-12 text-slate-400 mx-auto mb-4" />
              <h3 className="text-lg font-semibold text-slate-900 mb-2">
                {searchTerm || filter !== "all" ? "No matching submissions" : "No contact submissions yet"}
              </h3>
              <p className="text-slate-600">
                {searchTerm || filter !== "all" 
                  ? "Try adjusting your search or filter criteria." 
                  : "Contact forms submitted through the website will appear here."
                }
              </p>
            </GlassCardContent>
          </GlassCard>
        )}
      </div>
    </div>
  );
};

export default ContactSubmissions;
